import React from "react";
import { Switch, Route } from "react-router-dom";

function Container() {
  return (
    <Wrapper>
      <Switch>
        <Route exact path="/" component={() => <div>homepage</div>} />
        <Route path="/first" component={() => <div>first</div>} />
      </Switch>
    </Wrapper>
  );
}

export default Container;
